-- ----------------------------
-- Table structure for crm_trade_data
-- ----------------------------
DROP TABLE IF EXISTS `crm_trade_data`;
CREATE TABLE `crm_trade_data`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `product_code` int(11) NULL DEFAULT NULL COMMENT '商品编码',
  `product_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品名称',
  `trade_partner_code` int(11) NULL DEFAULT NULL COMMENT '贸易伙伴编码',
  `trade_partner_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '贸易伙伴名称',
  `trade_method_code` int(11) NULL DEFAULT NULL COMMENT '贸易方式编码\r\n',
  `trade_method_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '贸易方式名称',
  `location_code` int(11) NULL DEFAULT NULL COMMENT '注册地编码',
  `location_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '注册地名称',
  `first_quantity` bigint(20) NULL DEFAULT NULL COMMENT '第一数量',
  `first_measurement_unit` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '第一计量单位\r\n',
  `second_quantity` bigint(20) NULL DEFAULT NULL COMMENT '第二数量',
  `second_measurement_unit` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '第二计量单位',
  `trade_amount` float NULL DEFAULT NULL COMMENT '金额/人民币',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 260 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

